import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { GameComponent } from './game/game.component';



@NgModule({
  declarations: [
    GameComponent
  ],
  imports: [
    CommonModule
  ]
})
export class GameModule { }
